			this.newCollector = "MDL Group Upload new";
			this.newCompleteDate = envianceSdk.IsoDate.parse("2016-01-01T00:00:00");
			this.newMdlGroup = "";
			
			// Excel file body for updMdlGroup content 
			// Collector			CompleteDate		Material/Activity		StartTime			EndTime				SUV 2 for mdlg upload	SUV 1 for mdlg upload
			// MDL Group Upload new	1/1/2016 12:00 AM	Materia for MDLG-upload	1/1/2015 12:00 AM	1/2/2015 12:00 AM	50						100
			this.updValueSUV_2 = "50";
			this.updMdlGroup = "";

			// Excel file body for bulkCreateMdlGroup content 
			// Collector			CompleteDate		Material/Activity		StartTime			EndTime				SUV 2 for mdlg upload	SUV 1 for mdlg upload
			// MDL Group Upload 1	02.01.2016 12:00 AM	Materia for MDLG-upload	1/1/2015 12:00 AM	1/2/2015 12:00 AM	200	100
			// blank space			
			// MDL Group Upload 2	03.01.2016 12:00 AM	Materia for MDLG-upload	1/1/2015 12:00 AM	1/2/2015 12:00 AM	100	50
			this.bulkCollector1 = "MDL Group Upload 1";
			this.bulkCollector2 = "MDL Group Upload 2";
			this.bulkCompleteDate1 = envianceSdk.IsoDate.parse("2016-02-01T00:00:00");
			this.bulkCompleteDate2 = envianceSdk.IsoDate.parse("2016-03-01T00:00:00");
