	asyncTest("EnterData MDLGroup - Happy path - Check warnings", 33, function () {
		var self = this;
		var queue = new ActionQueue(this);
		var mdlGroupInfo = this.buildMdlGroupInfo("Create MdlGroup-Happy path", this.complete, this.dataLines);
		var mdlGroupInfo1 = this.buildMdlGroupInfo("Create MdlGroup_1-Happy path", this.complete_1, this.dataLines_1);

		queue.enqueue(function (context) {
			envianceSdk.materialData.enterMaterialData([mdlGroupInfo, mdlGroupInfo1], "True" ,
				function (response) {
					equal(response.metadata.statusCode, 200, "Status code OK");
					queue.executeNext();
				}, context.errorHandler);
		});

		queue.enqueue(function (context) {
			envianceSdk.materialData.getMaterialData(self.activityIdOrName1, self.complete, self.complete_1, self.generatedPoiPath,
				function (response) {
					equal(response.metadata.statusCode, 200, "Status code OK");
					context.compareMdlGroupInfo(response.result, [mdlGroupInfo, mdlGroupInfo1], context);
					start();
				}, context.errorHandler);
		});

		queue.executeNext();
	});
	
	asyncTest("Create MdlGroup - Fault if wrong complete date", 2, function () {
		var self = this;
		var queue = new ActionQueue(this);
		var completeData = new Date(Date.parse("1/1/2012 12:00 AM"));
		var mdlGroupInfo = this.buildMdlGroupInfo("CreateMdlGroup-FaultComplete", completeData, this.dataLines);

		envianceSdk.materialData.enterMaterialData([mdlGroupInfo], "true", 
			this.successHandler,
			function (response) {
			equal(response.metadata.statusCode, 500, "Status code OK.");
			equal(response.error.errorNumber, 0, "Error material data OK. The error message: " + response.error.message);
			start();
		});
	});

	
