	asyncTest("DeleteData MdlGroups - by IDs - Happy Path", 2, function () {
		var queue = new ActionQueue(this);
		var mdlgIds = [];
		
		queue.enqueue(function (context) {
			envianceSdk.materialData.getMaterialData(context.activityIdOrName1, context.complete, context.complete_1, context.generatedPoiPath,
				function (response) {
					equal(response.metadata.statusCode, 200, "Status code OK");
					mdlgIds.push(response.result[0].id);
					mdlgIds.push(response.result[1].id);
					queue.executeNext();
				}, context.errorHandler);
		});

		queue.enqueue(function (context) {
			envianceSdk.materialData.deleteMaterialData(context.generatedPoiPath, mdlgIds, true,
				function (response) {
					equal(response.metadata.statusCode, 200, "Status code is correct.");
					start();
				}, context.errorHandler);
		});
		queue.executeNext();
	});
	
